using System;\nusing System.Collections.Generic;\n\npublic class Program\n{\n    public static void Main()\n    {\n        List<int> ListA = new List<int> { 1, 2, 3 };\n        List<int> ListB = new List<int> { 4, 5, 3 };\n\n        bool hasCommonElement = CheckForIntersection(ListA, ListB);\n        Console.WriteLine(hasCommonElement); // Outputs: True\n    }\n\n    public static bool CheckForIntersection(List<int> listA, List<int> listB)\n    {\n        HashSet<int> set = new HashSet<int>(listA);\n\n        foreach (int item in listB)\n        {\n            if (set.Contains(item))\n            {\n                return true;\n            }\n        }\n\n        return false;\n    }\n}